INSERT INTO `privacy_policies` (`id`, `content`, `created_at`, `updated_at`) VALUES
(1, '<h2>Privacy Policy for The Marian House</h2><p><strong>Effective Date:</strong> 01st January 2025</p><p>At The Marian House, your privacy is important to us. This Privacy Policy explains how we collect, use, and protect your information when you use our app and services.</p><h2>1. Information We Collect</h2><h3>1.1. Personal Information:</h3><p>We collect information such as your name, email address, and contact details when you create an account or interact with our services.</p><h3>1.2. Location Data:</h3><p>Our app may access your location to provide location-based services, such as tailored recommendations and delivery options.</p><h3>1.3. Automatically Collected Information:</h3><p>We collect data about your device, including IP address, browser type, operating system, and usage details.</p><h3>1.4. Cookies and Tracking Technologies:</h3><p>We use cookies to enhance your app experience and track usage patterns.</p><h2>2. How We Use Your Information</h2><h3>2.1. Service Delivery:</h3><p>We use your data to operate and improve our services, customise user experiences, and fulfil requests.</p><h3>2.2. Communication:</h3><p>We may send emails, notifications, or updates regarding your account or our services.</p><h3>2.3. Analytics:</h3><p>Your information helps us analyse trends, measure performance, and improve user experience.</p><h2>3. Sharing Your Information</h2><h3>3.1. Third-Party Service Providers:</h3><p>We may share data with service providers for payment processing, hosting, and analytics.</p><h3>3.2. Legal Obligations:</h3><p>We disclose information to comply with legal requests or protect rights and safety.</p><h3>3.3. Business Transfers:</h3><p>In the event of a merger or sale, your data may be transferred as part of the transaction.</p><h2>4. Data Security</h2><p>We implement reasonable measures to secure your data but cannot guarantee 100% security due to inherent internet risks.</p><h2>5. Your Choices</h2><h3>5.1. Manage Account:</h3><p>You can update or delete your account information through the app.</p><h3>5.2. Location and Cookies:</h3><p>You can disable location access and cookies via device settings, though this may limit functionality.</p><h2>6. Children\'s Privacy</h2><p>Our app is not intended for users under 13 years of age. We do not knowingly collect data from children.</p><h2>7. Changes to This Policy</h2><p>We may update this policy periodically. Changes will be posted within the app and on our website.</p><h2>8. Data Deletion Policy</h2><p>Our app includes an in-app account deletion feature. Users can delete their account directly from within the mobile app by navigating to the Account Settings or Profile section and selecting the Delete Account option. Upon confirmation, all associated user data is permanently deleted from our servers in accordance with our privacy policy</p><ul><li>Using the account settings section in the app to delete your account, if available.</li><li>Or by contacting us directly at <a href=\"mailto:info@thehalalfood.co.uk\">info@marianhouse.co.uk</a> with the subject line \"Data Deletion Request\".</li></ul><p>Upon receiving your request, we will delete your personal data from our systems within 30 days, unless we are required to retain it for legal or regulatory purposes.</p><h2>9. Camera Access</h2><p>Our app may request access to your device\'s camera strictly for the purpose of allowing you to update your profile picture. This functionality is optional and only used when you choose to take or upload a photo for your account.</p><p>We do not access or store any images unless you explicitly choose to capture and save a profile picture through the app. All images captured are used solely for profile display and are not shared with third parties.</p><p>You can manage or revoke camera permissions at any time through your device settings.</p><h2>10. Contact Us</h2><p>For privacy-related inquiries:</p><p>Email: <a href=\"mailto:info@thehalalfood.co.uk\">info@marianhouse.co.uk</a></p><p>By using &nbsp;Marian House, you agree to this Privacy Policy.</p>', '2025-07-16 06:34:30', '2025-09-09 08:20:36');
